Meet John Doe (1941)

As a parting shot, fired reporter Ann Mitchell prints a fake letter from unemployed &quot;John Doe,&quot; who threatens suicide in protest of social ills. The paper is forced to rehire Ann and hires John Willoughby to impersonate &quot;Doe.&quot; Ann and her bosses cynically milk the story for all it&amp;#039;s worth, until the made-up &quot;John Doe&quot; philosophy starts a whole political movement. At last everyone, even Ann, takes her creation seriously... but publisher D.B. Norton has a secret plan.

